import axios from 'axios';

const API_BASE_URL = 'http://localhost:8000/api/sessions/';

const sessionService = {
    getAllServices: async () => {
        const response = await axios.get(API_BASE_URL);
        return response.data;
    },

    getSessionById: async (sessionId) => {
        const response = await axios.get(`${API_BASE_URL}${sessionId}`);
        return response.data;
    },

    createSession: async (data) => {
        const response = await axios.post(API_BASE_URL, data);
        return response.data;
    },

    updateSession: async (sessionId, data) => {
        const response = await axios.put(`${API_BASE_URL}${sessionId}`, data);
        return response.data;
    },

    deleteSession: async (sessionId) => {
        await axios.delete(`${API_BASE_URL}${sessionId}`);
    },
};

export default sessionService;
